                <h1 className="ui centered">Details Successfully Saved</h1>
                <div style={{paddingTop: '3%'}}>
                  <Link to="/">
                    <Button variant="danger"> Restart  </Button>
                  </Link>
                </div>
            </div>
        )
    }
}

export default Success;
